treatment of them is to tokenise e.g. isn't as is/VBZ n't/RB. This is
incorrect for several reasons: firstly, you need to add non-words like
`wo' and `ca' to the lexicon to make the treatment work for `won't'
and `can't'; and secondly, you need to tag something like `need' as
VBZ when it occurs in something like `he need+n't leave tomorrow'
(cf. he needs to leave tomorrow) There is no such tag assigned
anywhere in the corpus, for the good reason that need does not end in
s, so such sentences will always get analysed wrongly
----------------------------------------------------------------------*/



